INSERT INTO `participantes` VALUES(1530, 2, 'null', 'null', 'null', 'null', 0, NULL, 'N', 'BORJA', 'JIMENEZ FERNANDEZ', 'M', '1994-01-01', NULL, '', '', 'null', 'null', 'null', '', '699653247', 'TOMASSANMIGUEL@YAHOO.ES', 'ATLETICO LAREDO - CAMPING LAREDO', 's857', 'null', 'null', 'HOLA ALEX: \nHEMOS HABLADO ESTA MAÃ‘ANA POR TELF.SOY TOMAS SAN MIGUEL (C.AT.LAREDO),SOY EL ENTRENADOR DE 3 ATLETAS QUE HE INSCRITO PARA EL MEETING Y TAMBIEN SOY EL ORGANIZADOR DE LA MILLA COSTA ESMERALDA DE LAREDO Q ESTE AÃ‘O NO PODEMOS SACAR POR FALTA DE PRESUPUESTO.\nESTE ES EL ATLETA JUNIOR QUE TE HE COMENTADO Q ME GUSTARIA QUE METIERAIS EN EL 800 DE CARA A QUE TENGA LA OPORTUNIDAD DE REALIZAR MINIMA PARA CTO.ESPAÃ‘A JUNIOR Q ES EL DIA 23.06 Y QUE NO VA A TENER MAS OPORTUNIDADES DE INTENTARLO PUES LA FECHA ESTA ENCIMA. SE QUE INCLUSO LA SERIE B PUEDE QUE SEA RAPIDA (HACER UNA SERIE \"C\" COMO EN MILKI HOMBREÂ¡Â¡... :-) POR ESO QUIERO PEDIRTE POR FAVOR LE DEIS LA OPORTUNIDAD DE CORRER PUES HA ESTADO LESIONADO MEDIO INVIERNO Y AHORA ESTA ENTRENANDO DE MARAVILLA. EN TU CARRERA PODRIA CORRER POR DEBAJO DEL 1:57 QUE PIDE LA RFEA Y ES PROBABLE QUE EL 1:59 QUE ACREDITA HOY LO MEJORE EN EL CTO. DE ASTURIAS JUNIOR DE AVILES EL PROX. MIERCOLES, EN ESE CASO TE AVISARIA PARA MEJORARLE LA MARCA DE INSCRIPCION.\n\nGRACIAS DE ANTEMANO Y QUEDO A LA ESPERA DE TU CONFIRMACION', NULL, 0);
